import React from 'react'
import { useUsuarios } from '../../Context/Usuarios'
function VerUsuarios() {

    const {getUsuarios} = useUsuarios
    useEffect(()=>{
        getUsuarios()
    },[])
  return (
    <div>VerUsuarios</div>
  )
}

export default VerUsuarios
